import React from "react";

const Dashboard = () => {
  // In a real app, you’d fetch user/account data from backend here
  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Welcome to Your Dashboard</h1>
      <p style={styles.text}>
        Here you can view your account details, check transactions, and manage your finances.
      </p>
      <div style={styles.card}>
        <h3>Account Summary</h3>
        <p><strong>Account Type:</strong> Savings</p>
        <p><strong>Balance:</strong> ₹25,000.00</p>
      </div>
    </div>
  );
};

// Inline styling
const styles = {
  container: {
    height: "100vh",
    backgroundColor: "#f0f4ff",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
  },
  heading: {
    color: "#333",
  },
  text: {
    margin: "10px 0 20px",
    color: "#555",
  },
  card: {
    backgroundColor: "white",
    padding: "20px",
    borderRadius: "10px",
    boxShadow: "0 2px 8px rgba(0,0,0,0.1)",
    width: "300px",
    textAlign: "left",
  },
};

export default Dashboard;
